import {useForm} from 'react-hook-form'
import { useLocation } from 'react-router-dom'

const prevState = {
    email: "Zorahida@zorahida.com",
    password:"Hola"
}
 const Login = ({ LoginUser, LogError}) => {
    const location = useLocation()
    const { state } = location
 
const [form, setForm] = useState(prevState)
 
    const dataUser = (ev) => {
        const { value, name } = ev.target;
        setForm({...form, [name]: value })
    
    const submitForm = (ev) => {
        ev.preventDefault();
        LoginUser(form, state ? state.prevRoute: null)
        setForm(prevState);
    }
    
    return (
        <div>
        <form onSubmit={submitForm}>
            <input type= 'text' placeholder= 
            'name' {...register('name', {required: "Debes introducir tu nombre"})}
            />

            <input type='email' placeholder='Dejanos tu email'
            {...register('email')}
            />
    
            <button type='submit'> Enviar </button>
        </form>            
    
        </div>
    )};
};
export default Login
